import React from "react";
import "./Head.css";

<style>
@import url('https://fonts.googleapis.com/css2?family=Great+Vibes&family=Imperial+Script&family=Montserrat:ital,wght@0,100..900;1,100..900&display=swap');
</style>


const Head = () => {
    return(
    <>
        <h3>Визитная карточка</h3>
        <p>Дмитрий Панов</p>
    </>
)}

export default Head;
